type SquareProps = {
  value: string;
  isSelected: boolean;
  onClick: () => void;
};

export default function Square({ value, isSelected, onClick }: SquareProps) {
  return (
    <div
      onClick={onClick}
      style={{
        width: "50px",
        height: "50px",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        border: "1px solid black",
        backgroundColor: isSelected ? "yellow" : "white",
        cursor: "pointer"
      }}
    >
      {value}
    </div>
  );
}
